import React from 'react'

function Footer() {
  return (
    <footer>
        <div className='container'>
            <div className='row'>
                <div className='col text-center py-3'>Copyright &copy; Proshop</div>
            </div>                
        </div>
    </footer>
  )
}

export default Footer
